package com.example.propert_app.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class SubCategoryModel {    @SerializedName("status")    @Expose    public Integer status;    @SerializedName("message")    @Expose    public String message;    @SerializedName("data")    @Expose    public Data data;    public SubCategoryModel(Integer status, String message, Data data) {        super();        this.status = status;        this.message = message;        this.data = data;    }    public class Data {        @SerializedName("sub_categories")        @Expose        public List<SubCategory> subCategories = null;        public Data(List<SubCategory> subCategories) {            super();            this.subCategories = subCategories;        }        public class SubCategory {            @SerializedName("id")            @Expose            public Integer id;            @SerializedName("name")            @Expose            public String name;            @SerializedName("icon")            @Expose            public String icon;            public SubCategory(Integer id, String name, String icon) {                super();                this.id = id;                this.name = name;                this.icon = icon;            }        }    }}